%[text] %[text:anchor:T_856553D9] # **Clock Chart Examples**
%[text] %[text:anchor:H_5247FA2F] **Overview**
%[text] The `ClockChart` creates an analog clock backed by a MATLAB `timer` object for timekeeping. This chart illustrates the use of timer objects to schedule chart updates. The timer's callback property **`TimerFcn`** is implemented as a private chart method. The chart also needs to manage the lifecycle of the timer by deleting it when the chart is deleted. We do not have direct access to the chart's destructor method, so the approach is to create a listener to the chart event `ObjectBeingDestroyed`.
%[text] ```matlabCodeExample
%[text] weakObj = matlab.lang.WeakReference( obj );
%[text] callback = @( varargin ) weakObj.Handle.onChartDeleted( varargin{:} );
%[text] obj.DestructionListener = listener( obj, "ObjectBeingDestroyed", callback );
%[text] ```
%[text] The listener callback **`onChartDeleted`** is implemented as a private chart method, and is responsible for safely disposing of the timer.
%[text] ```matlabCodeExample
%[text] function onChartDeleted( obj, ~, ~ )
%[text] %ONCHARTDELETED Respond to the destruction of the chart by
%[text] %tidying up the timer object.
%[text] 
%[text] if obj.Timer.Running == "on"
%[text]     stop( obj.Timer )
%[text] end % if
%[text] 
%[text] delete( obj.Timer )
%[text] 
%[text] end % onChartDeleted
%[text] ```
