%[text] **Documentation**
%[text] - [`timer`](<matlab: doc timer>): Schedule execution of MATLAB commands
%[text] - [`patch`](<matlab: doc patch>): Create patches of colored polygons
%[text] - [`line`](<matlab: doc line>): Create primitive line \
