%[text] %[text:anchor:H_667F159A] ## Create a figure for the chart.
f = exampleFigure( "Name", "ClockChart Example" ); %[output:2067635c]
%%
%[text] %[text:anchor:H_4B7C58CC] ## Create the chart, specifying the parent.
CC = ClockChart( "Parent", f ); %[output:2067635c]
